import React, { useState, useEffect, useRef } from 'react';
import { Link } from 'react-router-dom';
import anime from 'animejs/lib/anime.es.js';
import Footer from './footer';

const HomePage = () => {
  const [isMobileView, setIsMobileView] = useState(false);
  const systemLogRef = useRef(null);
  const [typedText, setTypedText] = useState('');
  const [cursor, setCursor] = useState('|');  // Simulate typing cursor

  // Typing effect for System Log
  const typeWriterEffect = (text, index = 0) => {
    if (index < text.length) {
      setTypedText(typedText + text.charAt(index));
      setTimeout(() => typeWriterEffect(text, index + 1), 100);
    } else {
      // Blink cursor after typing the full text
      setTimeout(() => setCursor(cursor === '|' ? ' ' : '|'), 500);
    }
  };

  useEffect(() => {
    const handleResize = () => {
      setIsMobileView(window.innerWidth <= 1050);
    };

    handleResize();

    // Initialize typing effect for system log content
    const systemLogText = [
      'Title: Full Stack Developer',
      'Skills: JavaScript, React, Node.js, Python, Data Analysis, Pandas, Web Scraping',
      'Experience: 5+ years',
      'Booting...',
      'Welcome back, User.',
      'All systems operational.',
      'System update complete.',
    ];

    let textToType = systemLogText.join('\n'); // Combine all lines into a single string for the typing effect
    typeWriterEffect(textToType);

    window.addEventListener('resize', handleResize);
    return () => {
      window.removeEventListener('resize', handleResize);
    };
  }, []);

  // Styles
  const commonStyle = {
    color: '#00FF00',
    backgroundColor: '#1A1A1A',
    minHeight: '100vh',
    fontFamily: "'Courier New', Courier, monospace",
    textAlign: 'center',
    padding: '0 20px',
    boxSizing: 'border-box',
  };

  const pipBoyFrameStyle = {
    border: '5px solid #00FF00',
    padding: '20px',
    borderRadius: '10px',
    boxShadow: '0 0 10px 0 rgba(0, 255, 0, 0.5)',
    margin: '0 auto',
    maxWidth: '80%',
    position: 'relative',
    minHeight: '100vh',
  };

  const systemLogStyle = {
    position: 'absolute',
    top: '50%',
    left: '50%',
    transform: 'translate(-50%, -50%)',
    width: '80%',
    color: '#00FF00',
    fontFamily: "'Courier New', Courier, monospace",
    padding: '20px',
    backgroundColor: '#171717',
    borderRadius: '10px',
    boxShadow: '0 0 10px rgba(0, 255, 0, 0.5)',
    whiteSpace: 'pre-wrap',  // Preserve whitespace formatting
    fontSize: '18px',
    lineHeight: '1.6',
  };

  const buttonStyle = {
    padding: '10px 20px',
    border: '2px solid #00FF00',
    color: '#00FF00',
    textDecoration: 'none',
    borderRadius: '5px',
    fontSize: '18px',
    transition: 'background-color 0.3s, color 0.3s',
  };

  const interestsStyle = {
    backgroundColor: '#2D2D2D',
    color: '#00FF00',
    padding: '20px',
    width: '250px',
    height: 'auto',
    borderRadius: '10px',
    boxShadow: '0 0 10px rgba(0, 255, 0, 0.5)',
    marginTop: '20px',
    border: '2px solid #00FF00',
    textAlign: 'left',
    paddingLeft: '15px',
  };

  return (
    <div style={commonStyle}>
      {/* Pip-Boy Frame around the page */}
      <div style={pipBoyFrameStyle}>
        <header style={{ textAlign: 'center', marginBottom: '30px' }}>
          <h1 style={{ fontSize: isMobileView ? '25px' : '40px', fontWeight: 'bold' }}>
            Hi, I'm Mohammed 👋
          </h1>
          <p style={{ fontSize: isMobileView ? '18px' : '24px' }}>
            I have been coding and analyzing data for 5+ years 🤖
          </p>
        </header>

        {/* System Log */}
        <div ref={systemLogRef} style={systemLogStyle}>
          {typedText}
          <span>{cursor}</span>
        </div>

        {/* Buttons */}
        <div style={{ margin: '2rem', display: 'flex', justifyContent: 'center', gap: '1rem' }}>
          <Link
            to="/about"
            style={buttonStyle}
            onMouseEnter={(e) => {
              e.target.style.backgroundColor = '#003300';
              e.target.style.color = '#00FF00';
            }}
            onMouseLeave={(e) => {
              e.target.style.backgroundColor = 'transparent';
              e.target.style.color = '#00FF00';
            }}
          >
            About Me
          </Link>
          <a
            href="https://react--portfolio.s3.eu-west-2.amazonaws.com/Mohammed+Bakhshi+CV+.pdf"
            download="Mohammed_Bakhshi_CV.pdf"
            target="_blank"
            rel="noopener noreferrer"
            style={buttonStyle}
            onMouseEnter={(e) => {
              e.target.style.backgroundColor = '#003300';
              e.target.style.color = '#00FF00';
            }}
            onMouseLeave={(e) => {
              e.target.style.backgroundColor = 'transparent';
              e.target.style.color = '#00FF00';
            }}
          >
            View CV
          </a>
        </div>

        {/* Interests inside the Pip-Boy frame */}
        <div style={interestsStyle}>
          <h3>Interests</h3>
          <ul>
            <li>Web Development</li>
            <li>Data Science</li>
            <li>Machine Learning</li>
            <li>Gaming</li>
            <li>Reading</li>
          </ul>
        </div>
      </div>

      <Footer />
    </div>
  );
};

export default HomePage;
